import React from 'react';
import styled from 'styled-components';
import {KineBox} from "../../styles/style";

const Styles = styled.div`
    .right {
        display: inline-block;
    }
`;

class Home extends React.Component {
    constructor(props) {
        super(props);
        document.title = "Home";
    }

    render() {
        return (
            <KineBox/>
        );
    }
}

export default Home;
